let rowsALT = total_Stops;
let colsALT = total_Stops;

for (let i = 0; i < rowsALT; i++) {
    let row = [];
    for (let j = 0; j < colsALT; j++) {
        if (i == j) {
            row.push(0);
        } else {
            row.push("REDIRECT");
        }
    }
    array_ALT_RT.push(row);
}

function altRouteSetter(m, s, d, route) {
    let sRef;
    let dRef;

    if (m == 1) {
        // SINGLE SOURCE & DESTINATION
        sRef = SHD.indexOf(s);
        dRef = SHD.indexOf(d);
        array_ALT_RT[sRef][dRef] = route;
    } else if (m == 2) {
        // MULTI SOURCE & SINGLE DESTINATION
        dRef = SHD.indexOf(d);
        for (let i = 0; i < s.length; i++) {
            sRef = SHD.indexOf(s[i]);
            array_ALT_RT[sRef][dRef] = route;
        }
    } else if (m == 3) {
        // SINGLE SOURCE & MULTI DESTINATION
        sRef = SHD.indexOf(s);
        for (let i = 0; i < d.length; i++) {
            dRef = SHD.indexOf(d[i]);
            array_ALT_RT[sRef][dRef] = route;
        }
    } else if (m == 4) {
        // MULTI SOURCE & MULTI DESTINATION
        for (let i = 0; i < s.length; i++) {
            sRef = SHD.indexOf(s[i]);
            for (let j = 0; j < d.length; j++) {
                dRef = SHD.indexOf(d[j]);
                array_ALT_RT[sRef][dRef] = route;
            }
        }
    }
}

function altRouteGetter(s, d) {
    let sRef = SHD.indexOf(s);
    let dRef = SHD.indexOf(d);

    return array_ALT_RT[sRef][dRef];
}

function getALTroute(src, dst) {
    let i = SHD.indexOf(src);
    let j = SHD.indexOf(dst);
    return array_ALT_RT[i][j];
}

function checkALTroute(from, to) {
    console.log(array_ALT_RT[SHD.indexOf(from)][SHD.indexOf(to)]);
}

